#include "Span.hpp"

/*
1) Init Span
- invalid argument: -1 0 4 (size must be atleast 5) throw exception
- Int max and unsigned Int max
- also print max size
*/
void init_span()
{
    int size[] = {-1, 0, 4};
    for (int i=0; i < 3; i++)
    {
        try {Span test(size[i]);} 
        catch (std::exception &e) 
        {std::cerr << RED "Exception caught: " RESET << e.what();}
    }
    
    Span a(INT_MAX);
    Span b(UINT_MAX);
    std::cout << "Size of a: " << a.getMaxSize() << "\n"
              << "Size of b: " << b.getMaxSize() << "\n";
}


 /*
2) add number
size of 5
- add 5 numbers using single function, view, try adding a one more (throw error)

size is 25
- add range using vector = 10
- add range using int array = 10

- view added numbers
- add another 5 more (throw exception)
*/
void add_number()
{
    try {
        Span a(5);
        a.addNumber(5);
        a.addNumber(20);
        a.addNumber(-321);
        a.addNumber(1000);
        a.addNumber(-32013);
        a.showNumbers();
        a.addNumber(55);
    } catch (std::exception &e)
    {std::cerr << RED "Exception caught: " RESET << e.what();}


    try {
        Span b(24);
        std::vector<int> batch_1;
        batch_1.push_back(89);
        batch_1.push_back(84);
        batch_1.push_back(63);
        batch_1.push_back(81);
        batch_1.push_back(66);
        batch_1.push_back(76);
        batch_1.push_back(31);
        batch_1.push_back(3);
        batch_1.push_back(4);
        batch_1.push_back(41);

        int batch_2[10] = {97, 17, 51, 75, 12, 38, 7, 56, 46, 43};
        b.addNumber(batch_1.begin(), batch_1.end());
        b.addNumber(batch_2, batch_2 + 10);
        b.showNumbers();

        int batch_3[10] = {10, 96, 94, 100, 49, 90, 26, 8, 32, 61};
        b.addNumber(batch_3, batch_3 + 10);
    } catch (std::exception &e)
    {std::cerr << RED "Exception caught: " RESET << e.what();}
}

/*
3) Test span calculation
- empty  
- only 1 number

- add pdf example and view
- test span
*/
void test_span()
{
    Span a(5);

    try {a.shortestSpan();} 
    catch (std::exception &e){std::cerr << RED "Exception caught: " RESET << e.what();}
    try {a.longestSpan();} 
    catch (std::exception &e){std::cerr << RED "Exception caught: " RESET << e.what();}

    a.addNumber(6);

    try {a.shortestSpan();} 
    catch (std::exception &e){std::cerr << RED "Exception caught: " RESET << e.what();}
    try {a.longestSpan();} 
    catch (std::exception &e){std::cerr << RED "Exception caught: " RESET << e.what();}

    a.addNumber(3);
    a.addNumber(17);
    a.addNumber(9);
    a.addNumber(11);

    a.showNumbers();
    std::cout << a.shortestSpan() << "\n";
    std::cout << a.longestSpan() << "\n";
}

